import React from 'react';
import Box from '@mui/material/Box';
import TextField from '@mui/material/TextField';
import Card from '@mui/material/Card';
import CardContent from '@mui/material/CardContent';
import CardMedia from '@mui/material/CardMedia';





function AddCustomDish() {



    return (

        <Card>
            <CardContent>
                <CardMedia
                    component="img"
                    height="300"
                    image='https://res.cloudinary.com/crunchbase-production/image/upload/c_lpad,f_auto,q_auto:eco,dpr_1/v1479829522/bxpgav8mvdsibvxctd1d.jpg'
                    alt="" />
                <TextField label={'Dish title'} id="margin-none" />
                <br />
                <br />
                <TextField label={'Dish description...'} id="margin-dense" margin="dense" flex-wrap='nowrap' />
            </CardContent>
        </Card >


    )
}


export default AddCustomDish;
